import React, { Component,Fragment} from 'react';

class TodoList extends Component{


    constructor(prop){
        super(prop);
        this.state = {
            inputV : "Hello",
            test: []
        };
    }
    change(e){
        this.setState(
            this.inputV = e.target.value
        )
    }
    render(){
        return(
            <Fragment>
                <input
                    value={this.state.inputV}
                    onChange={this.change.bing(this)}
                />
                <ul>
                    <li>待完成</li>
                    <li>已完成</li>
                </ul>
            </Fragment>
        );
    }
}

export default TodoList;
